    public HashMap<String, String> getMapaUrzadKod() {
        return mapaUrzadKod;
    }

    public void setMapaUrzadKod(HashMap<String, String> mapaUrzadKod) {
        this.mapaUrzadKod = mapaUrzadKod;
    }

    public List<String> getNazwyurzedow() {
        return nazwyurzedow;
    }

    
    public void setNazwyurzedow(List<String> nazwyurzedow) {
        this.nazwyurzedow = nazwyurzedow;
    }
    
    public List<String> complete(String query){  
        List<String> results = Collections.synchronizedList(new ArrayList<>());
        for(String p : nazwyurzedow) {  
            if(p.contains(query.toUpperCase())) {
                results.add(p);
            }
        }
        return results;
    }  
    
    public String duzeliter() {
        String wyraz = "bole";
        return wyraz.toUpperCase();
    }		

    public static String getNazwaUrzedu(String kodurzedu) {
        String zwrot = "nie znaleziono";
        for (String p : mapaUrzadKod.keySet()) {
            if (mapaUrzadKod.get(p).equals(kodurzedu)) {
                zwrot = p;
            }
        }
        return zwrot;
    }
    
